import React, { Component } from 'react';
import './Main.css';

class Main extends Component {
  render() {
    return (
      <div className="main">
        <p className="main-we"> <span> W </span><span> E </span> </p>
        <p>-</p>
        <p className="main-are" >ARE</p>
        <p className="main-about" id="about-text">ABOUT</p>
        <p className="main-experiences" id="experiences-text">EXPERIENCES</p>
      </div>
    );
  }
}

export default Main;
